(schema revel8schema [(nodelabels [Loop Element Sensor Actuator Process Controller Enforcement Constraint ProcessModel])
                      (edgelabels [system sl se al ae pl pe cl ce ec et m sys])
                      (unique Loop name)
                      (unique Element name)])
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;revel8/revel8schema</span>","value":"#'revel8/revel8schema"}
;; <=

;; @@


(list 
 (rule system [sn]
       (create (node s:System {:name "'&sn'"})))
 
(rule loop [ln cn pn]
      (create (node l:Loop {:name "'&ln'" })
              (node c:Controller )
              (node p:Process)
              (node pe:Element {:name "'&pn'"})
              (node ce:Element {:name "'&cn'"})
              (edge :r c ce)
              (edge :r p pe)
              (edge :r c l)
              (edge :r p l)
              )
      )
 
(rule add-to-system [en sn]
      (read (node s:System {:name "'&sn'"})
            (node e:Element {:name "'&en'"})
            (NAC (edge :env s e)))
      (create (edge :comp s e) ))
 
 (rule add-to-env [en sn]
      (read (node s:System {:name "'&sn'"})
            (node e:Element {:name "'&en'"})
            (NAC (edge :comp s e)))
      (create (edge :env s e) ))
            
(query elements? [sn]
        	(node s:System {:name "'&sn'"})
            (node in:Element :opt)
         	(node out:Element :opt)
            (edge :env s out )
         	(edge :comp s in ))
 

      
      (query modifies? [en1 en2]
        (node l:Loop )
        (node e1:Element {:name "'&en1'"})
        (node e2:Element {:name "'&en2'"})
        (node r1:Actuator )
        (node r2:Process)
        (edge :r r1 l)
        (edge :r r2 l)
        (edge :r r1 e1)
        (edge :r r2 e2)) 
      
      
 
  (query serves? [en1 en2]
        (node l:Loop )
        (node e1:Element {:name "'&en1'"})
        (node e2:Element {:name "'&en2'"})
        (node r1:Actuator )
        (node r2:Controller)
        (edge :r r1 l)
        (edge :r r2 l)
        (edge :r r1 e1)
        (edge :r r2 e2))
 
   (query monitors? [en1 en2]
        (node l:Loop )
        (node e1:Element {:name "'&en1'"})
        (node e2:Element {:name "'&en2'"})
        (node r1:Sensor )
        (node r2:Process)
        (edge :r r1 l)
        (edge :r r2 l)
        (edge :r r1 e1)
        (edge :r r2 e2))
 
    (query informs? [en1 en2]
        (node l:Loop )
        (node e1:Element {:name "'&en1'"})
        (node e2:Element {:name "'&en2'"})
        (node r1:Sensor )
        (node r2:Controller)
        (edge :r r1 l)
        (edge :r r2 l)
        (edge :r r1 e1)
        (edge :r r2 e2))
 
     (query actuates? [en1 en2]
        (node l:Loop )
        (node e1:Element {:name "'&en1'"})
        (node e2:Element {:name "'&en2'"})
        (node r1:Controller )
        (node r2:Process)
        (edge :r r1 l)
        (edge :r r2 l)
        (edge :r r1 e1)
        (edge :r r2 e2)
        (NAC (node r3:Actuator)
             (edge :r r3 l)))
 
      (query senses? [en1 en2]
        (node l:Loop )
        (node e1:Element {:name "'&en1'"})
        (node e2:Element {:name "'&en2'"})
        (node r1:Process )
        (node r2:Controller)
        (edge :r r1 l)
        (edge :r r2 l)
        (edge :r r1 e1)
        (edge :r r2 e2)
        (NAC (node r3:Sensor)
             (edge :r r3 l)))

 )
